- оплаты муниципальных парковок в Краснодаре;
- пополнения парковочного счета;
- просмотра местонахождения городских парковок;
- просмотра информации по интересующей парковке и построения маршрута к ней;
- просмотра истории по парковочным сессиям, оплаченным с вашего телефона, как с помощью мобильного приложения, так и с помощью SMS.

IT Charge - ваш персональный помощник для удобной зарядки электромобиля. Оптимальный способ зарядить свой электромобиль или заряжаемый гибрид на кончиках пальцев.

IT Charge
▸  подскажет, где находятся электрические зарядные станции (ЭЗС)  вокруг Вас и статус их доступности в режиме онлайн;
▸  проложит путь до удобной доступной зарядной станции;
▸  позволит начать зарядную сессию прямо из приложения;
▸  покажет онлайн статус зарядной сессии;
▸  визуализирует технические подробности зарядной сессии;
▸  запомнит ваши предпочтения и предложит их при следующей поездке для вашего удобства.
Платформа IT Charge работает на благо популяризации электромобилей и зарядной инфраструктуры, в связи с чем функциональность платформы будут постоянно улучшаться и расширяться. Мы открыты для Ваших предложений и замечаний, которые мы рады будем получить от Вас через форму обратной связи или другой удобный для Вас способ связи.
